import React from 'react';
import './Gallery.css'; // Import the CSS file

const Gallery = () => {
    return (
        <div className="gallery">
            {[...Array(5)].map((_, index) => (
                <div className="picture-slot" key={index}>
                    <img src={`https://via.placeholder.com/300?text=Picture+${index + 1}`} alt={`Picture ${index + 1}`} />
                </div>
            ))}
        </div>
    );
};

export default Gallery;
